import React from 'react';
import { WrapperContent, WrapperLabelText, WrapperText } from './style';
import { WrapperPriceText } from '../CardComponent/style';

const NavbarComponent = () => 
{
    const renderContent = (type, options) => {
        switch(type) {
            case 'text':
                return options.map((option) => {
                    return (
                        <WrapperText>{option}</WrapperText>
                    )

                })
            case 'price':
                return options.map((option) => 
            {
                return(
                    <WrapperTextP>
                        {option}
                    </WrapperTextP>
                )
            })
            default:
                return {}
        }
    }

    return (
        <div>
            <WrapperLabelText>Gia</WrapperLabelText>
            <WrapperContent>
                {renderContent('price',['Duoi 500.000', '500.000 den 2.000.000', 'Tren 2.000.000'])}
            </WrapperContent>
        </div>
    )
}

export default NavbarComponent;
